import React from "react";
import { Router, Route, Switch } from "react-router-dom";
import "./App.css";
import Header from "./components/Header.jsx";
import List from './components/List.jsx';

function App() {
  return (
    <Router>
      <div className="App">
        <Header/>
        <Switch>
          <Route exact path="/" />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
